import React, { Component } from 'react';


class LogIn extends Component {
  render() {
    return (
      <React.Fragment>
        <label>Log In</label>
        <input
          type="email"
          name="your@eamil.com"
          value={this.state.username}
        />
      </React.Fragment>
    )
  }
}

export default LogIn;
